import React from 'react';
import TourGuideNavbar from './TourGuideNavbar';
import './TourGuidePuantage.css';
import PuantageTable from '../common/PuantageTable';

const TourGuidePuantage = () => {
  // Hardcoded list of tour guides and their assigned tours
  const tourGuides = [
    {
      id: 1,
      firstName: "John",
      lastName: "Doe",
      assignedTours: [
        { chosenDate: "2024-12-01", workHours: 2, applyingHighschool: { name: "High School A" }, visitorCount: 30 },
        { chosenDate: "2024-12-03", workHours: 3.5, applyingHighschool: { name: "High School B" }, visitorCount: 25 },
      ],
    },
    {
      id: 2,
      firstName: "Jane",
      lastName: "Smith",
      assignedTours: [
        { chosenDate: "2024-12-02", workHours: 4, applyingHighschool: { name: "High School C" }, visitorCount: 40 },
      ],
    },
    {
      id: 3,
      firstName: "Michael",
      lastName: "Brown",
      assignedTours: [
        { chosenDate: "2024-12-05", workHours: 1.5, applyingHighschool: { name: "High School D" }, visitorCount: 20 },
      ],
    },
    {
      id: 4,
      firstName: "Emily",
      lastName: "Davis",
      assignedTours: [],
    },
    {
      id: 5,
      firstName: "Chris",
      lastName: "Wilson",
      assignedTours: [
        { chosenDate: "2024-12-10", workHours: 3, applyingHighschool: { name: "High School E" }, visitorCount: 15 },
      ],
    },
    // Add more hardcoded tour guides here
  ];

  return (
    <div className="tourguide-puantage">
      <TourGuideNavbar />
      <PuantageTable users={tourGuides} />
    </div>
  );
};

export default TourGuidePuantage;
